import React, { useState } from "react";
import "boxicons";

const Navbar = () => {
  const [isShowMenu, setIsShowMenu] = useState(false);
  return (
    <div class="w-full h-16 bg-white fixed">
      <div class="w-full max-width-[1200px] flex justify-between items-center bg-white">
        <div class="ml-3 flex items-center gap-1">
          <img
            src={require("../assets/images/logo.png")}
            alt=""
            class="w-15 h-9 cursor-pointer"
          />
        </div>
        {isShowMenu ? (
          <ul class="w-full h-[calc(100vh-64px)] fixed top-16 bg-white animate-fade-in-right">
            <li class="px-6 py-3 active">Home</li>
            <li class="px-6 py-3">Menu</li>
            <li class="px-6 py-3">Service</li>
            <li class="px-6 py-3">Shop</li>
          </ul>
        ) : null}
        <box-icon
          name="menu"
          class="mr-3 cursor-pointer lg:hidden sm"
          onClick={() => setIsShowMenu(!isShowMenu)}
        ></box-icon>
      </div>
    </div>
  );
};

export default Navbar;
